/*Table structure for table `production_reportworkorder` */

DROP TABLE IF EXISTS `production_reportworkorder`;

CREATE TABLE `production_reportworkorder` (
  `ReportWorkOrder_Id` int(11) DEFAULT NULL,
  `WorkOrder_Id` varchar(200) DEFAULT NULL,
  `Process_Id` int(11) DEFAULT NULL,
  `Product_Id` int(11) DEFAULT NULL,
  `ProductCode` varchar(200) DEFAULT NULL,
  `ProductName` varchar(200) DEFAULT NULL,
  `ProductStandard` varchar(200) DEFAULT NULL,
  `ProcessStatus` varchar(200) DEFAULT NULL,
  `ProductUser` varchar(200) DEFAULT NULL,
  `ReportQty` int(11) DEFAULT NULL,
  `Unit_Id` int(11) DEFAULT NULL,
  `GoodQty` int(11) DEFAULT NULL,
  `NoGoodQty` int(11) DEFAULT NULL,
  `ProcessProgress` varchar(200) DEFAULT NULL,
  `StartDate` timestamp NULL DEFAULT NULL,
  `EndDate` timestamp NULL DEFAULT NULL,
  `ReoportDurationHour` int(11) DEFAULT NULL,
  `ReoportDurationMinute` int(11) DEFAULT NULL,
  `StandardProgress` varchar(200) DEFAULT NULL,
  `ActualProgress` varchar(200) DEFAULT NULL,
  `RateStandard` varchar(200) DEFAULT NULL,
  `PriceType` int(11) DEFAULT NULL,
  `UnitPrice` double DEFAULT NULL,
  `GuessPrice` double DEFAULT NULL,
  `ApproveStatus` int(11) DEFAULT NULL,
  `ApproveUser` varchar(200) DEFAULT NULL,
  `ReportTime` timestamp NULL DEFAULT NULL,
  `CreateDate` timestamp NULL DEFAULT NULL,
  `CreateID` int(11) DEFAULT NULL,
  `Creator` varchar(200) DEFAULT NULL,
  `Modifier` varchar(200) DEFAULT NULL,
  `ModifyDate` timestamp NULL DEFAULT NULL,
  `ModifyID` int(11) DEFAULT NULL
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

